import React from "react";
import './style.css';
import { Link } from 'react-router-dom'
import axios from 'axios'
import { CKEditor } from '@ckeditor/ckeditor5-react';
import ClassicEditor from '@ckeditor/ckeditor5-build-classic';

export function ReviewPage({
    history,
    match,
}) {
    const [content, setContent] = React.useState([])

    function getApplication() {
        return axios.get(`http://localhost:5001/api/apps/${match.params.id}`)
    }

    React.useEffect(() => {
        getApplication().then(({ data }) => {
            console.log(data)
            setContent(content)
        }).catch(err => {
            console.log(err)
        })
    }, [])

    return (
        <body>
            <h2>Review</h2>
            {cont.map(app => {
                    return (
                        <Link to={`/applications/review/${app.applicationId}`}>
                            <li key={app.applicationId} className="application-bar">
                                <span className="name">{app.user}#{app.tag} </span>
                                <span className="type">{app.appType} </span>
                                <span className="date">{app.date}</span>
                            </li>
                        </Link>
                    )
                })}
        </body>
    )
}
